// ==UserScript==
// @name         IMDB FraMeSToR Search v2
// @namespace    http://tampermonkey.net/
// @version      1.2
// @description  Search FraMeSToR remuxes from IMDB page
// @author       Hydrad updated by BEY0NDER
// @match        https://www.imdb.com/title*
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/452659/IMDB%20FraMeSToR%20Search%20v2.user.js
// @updateURL https://update.greasyfork.org/scripts/452659/IMDB%20FraMeSToR%20Search%20v2.meta.js
// ==/UserScript==

(function() {
    'use strict';

    const titleContainer = document.querySelectorAll('[data-testid="hero__pageTitle"]')[0];
    //const imdbId = document.querySelectorAll('.rating-bar__base-button')[0];
    const imdbURL = document.URL;
    var   imdbId  = imdbURL.replace('https://www.imdb.com/title/', '')
          imdbId  = imdbId.split('/')
    const searchURL = 'https://beyond-hd.me/torrents?search=&doSearch=Search&types%5B%5D=UHD+Remux&types%5B%5D=BD+Remux&tmdb=&framestor=1&sorting=bumped_at&direction=desc&qty=25&doSearch=Search';
    const base64Icon = 'data:image/png;base64,';
    const link = document.createElement('a');
    link.setAttribute('style', 'display: inline-block; width: 30px; height: 30px; margin-left: 10px;');
    link.setAttribute('href', `${searchURL}&imdb=${imdbId[0]}`);
    link.setAttribute("target", "_blank");
    const img = document.createElement('img');
    img.setAttribute('style', 'width: 100%');
    img.setAttribute('src', base64Icon);
    link.append(img);
    titleContainer.append(link);

})();